import Container from '../components/container';

function Index({ gifs: { data } }) {
  return (
    <Container>
      {data.map((gif) => (
        <li>
          <img src={gif.images.downsized_medium.url}></img>
        </li>
      ))}
      <style jsx>{`
        li {
          list-style-type: none;
        }
      `}</style>
    </Container>
  );
}

export async function getStaticProps() {
  const q = 'star wars';
  const apiKey = 'MABWKnnDnZ9l8dALV6HfxnH1DVYpoX1J';
  const response = await fetch(
    `http://api.giphy.com/v1/gifs/search?q=${q}&api_key=${apiKey}&limit=10`
  );
  const gifs = await response.json();

  return {
    props: {
      gifs,
    },
  };
}

export default Index;
